import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from '../Navbar/Nav/Nav';

const navbar = props => (
    <Navbar bg="danger" variant="light">
    <Navbar.Brand href="#home">DoE</Navbar.Brand>
    <Nav />
  </Navbar>
);

export default navbar;
